import {LuFileSymlink } from 'react-icons/lu';
import { IoBody } from "react-icons/io5";

import '../stylesheet/compsStyle/services.css';
export default function Services () {

    return (
        <>
        <div className='services-div'>
              <ul>
                <div>
                <li>
                    <Link to='/age'>حساب العمر</Link>
                </li>
                </div>
                <div>
                <li>
                    <Link to='/balanced'>حساب النسبة الموزونة</Link>
                </li>
                </div>
                <li>
                    <Link to=''>حساب السعرات الحرارية(<IoBody size={15}/>)</Link>
                </li>
                <li>
                    <Link to=''>تحويل الملفات<span><LuFileSymlink size={15}/></span></Link>
                </li>
              </ul>
        </div>
        </>
    )
};
